    false,nt"url": null,nt"notes": "The purpose of this project is to continue
    FWS involvement in the long-term, consistent monitoring of loggerhead sea turtle
    nesting to assess changes in phenological and spatial nesting distribution of the
    Northwest Atlantic subpopulation. Seven refuges support 25 to 50% of the global
    nesting population of this species. The Index Nesting Beach Survey is implemented
    by FWS, states and partners on a standardized set of index beaches. Data are essential
    for managers to monitor sea turtle population status between and among years regionally,
    nationally and internationally.",nt"license_title": "License Not Specified",nt"extras":
